import React from 'react';
import { Route, Routes } from 'react-router';
import NavigationMenu from './component/NavigationMenu';

function App() {
  return (
   <div className='app'>
    <NavigationMenu></NavigationMenu>
    <Routes>
      <Route path='/' element></Route>
    </Routes>
   </div>
  );
}

export default App;
